                        </div>
                    </div>
                    <div className='tableItem rowTwo'>
                        <p className='conTit'>정책 소개</p>
                        <p className='conTxt'>국민취업지원제도 참여 요건을 갖추신 분은 취업지원서비스를 제공받으실 수 있고 셍계를 위한 최소한의 소득도 지원받으실 수 있습니다.</p>
                    </div>
                    <div className='tableItem rowThr'>
                        <p className='conTit'>지원 내용</p>
                        <p className='conTxt'>
                            취업 지원<br />
                                - 직업 훈련, 일 경험, 취업 알선 제공 <br />
                                - 취업 지원 기간 종료 후 미취업자 대상 *사후관리 지원 <br />
                                *취업처 정보제공, 이력서 클리닉 등 구직기술향상 프로그램 제공, 유선상담 등 <br />

                            <br />

                            소득 지원<br />
                                - 1유형 : 취업 지원 서비스 참여 등 구직활동 의무 이행을 전제로 최저생계 보장을 위한 구직촉진수당(50×6개월) 지급 <br />
                                - 2유형 : 직업 훈련 참여 등 취업 지원 서비스 참여 시 발생하는 취업 활동 비용 일부 지원 <br />
                                - 공통 : 일정 요건이 해당되는 자에게 장기근속 유도를 위해 취업 후 근속기간에 따른 취업 성공 수당 최대 150만 원 지원 <br />
                                (단, 1유형 수급자에 대해서는 조기 취업 유도를 위해 조기 취업 성공 수당 50만 원 1회 추가 지원)
                        </p>
                    </div>
                    <div className='tableItem rowFou'>
                        <div className='colOne'>
                            <p className='conTit'>지원 규모(명)</p>
                            <p className='conTxt'></p>
                        </div>
                        <div className='colTwo'>
                            <p className='conTit'>비고</p>
                            <p className='conTxt'></p>
                        </div>
                    </div>
                    <div className='tableItem rowFiv'>
                        <p className='conTit'>정책 소개</p>
                        <p className='conTxt'>국민취업지원제도 참여 요건을 갖추신 분은 취업지원서비스를 제공받으실 수 있고 셍계를 위한 최소한의 소득도 지원받으실 수 있습니다.</p>
                    </div>
                    <div className='tableItem rowSix'>
                        <p className='conTit'>정책 소개</p>
                        <p className='conTxt'>국민취업지원제도 참여 요건을 갖추신 분은 취업지원서비스를 제공받으실 수 있고 셍계를 위한 최소한의 소득도 지원받으실 수 있습니다.</p>
                    </div>
                </div>
            </div>
        </div>
        </DetailPagesContainer>
    );
});

export default DetailPages;
